import React from 'react';
import "./button.css";



const DownloadButton = () => {
  const handleClick = () => {
    // Implement your download logic here
    window.open("https://example.com/your_file.txt", "_blank"); 
  };

  return (
    <button
      className="download-button"
      onClick={handleClick}
    >
      <span className="download-icon">{/* Replace with your download icon */}</span>
      Download File
    </button>
  );
};

export default DownloadButton;

